const Time={

    //输入时间字符串
    //输出具体时间
    time: (str)=>{
        if (str == null || str == "") return "";
        let PastTimeStamp=new Date(str)

        let NowTimeStamp=new Date().now()
        return PastTimeStamp
    },


}

export default Time
